for IDENTITY in "${!investor_data[@]}"
do
    investorText="investor"
    investorNumber=$((IDENTITY + 1))
    investorText+=$investorNumber

    dfx identity use "${investorText}"
    CURRENT_PRINCIPAL=$(dfx identity get-principal)
    echo "Using identity $investorText with principal $CURRENT_PRINCIPAL"

    # Extract and use the investor data for the current identity
    investor_DATA=${investor_data[$IDENTITY]}
    echo "Registering with data: $investor_DATA"

    # Call the register_investor function with the current identity and its unique data
    dfx canister call $CANISTER register_venture_capitalist "($investor_DATA)" --network ic

    # approve_vc_creation_request
    echo "approving the request"
    dfx canister call --identity default $CANISTER approve_vc_creation_request "(principal \"$CURRENT_PRINCIPAL\", true)" --network ic
done


